SET IDENTITY_INSERT [SysDistrict] ON;
GO
MERGE INTO [SysDistrict] AS trg USING (
	SELECT
		[DistrictId],
		[DistrictCode],
		[DistrictNameTH],
		[DistrictNameEN],
		[StateId]
	FROM [TmpSysDistrict]) AS src
ON trg.[DistrictId] = src.[DistrictId]
WHEN NOT MATCHED THEN
	INSERT ([DistrictId], [DistrictCode], [DistrictNameTH], [DistrictNameEN], [StateId])
	VALUES (src.[DistrictId], src.[DistrictCode], src.[DistrictNameTH], src.[DistrictNameEN], src.[StateId])
WHEN MATCHED THEN
	UPDATE SET
		trg.[DistrictCode] = src.[DistrictCode],
		trg.[DistrictNameTH] = src.[DistrictNameTH],
		trg.[DistrictNameEN] = src.[DistrictNameEN],
		trg.[StateId] = src.[StateId];
GO
SET IDENTITY_INSERT [SysDistrict] OFF;
GO
DROP TABLE [TmpSysDistrict];
GO